Identifikatur tal-Liċenzja, li jkun identifikatur globalment uniku għal liċenzja jew kuntratt taħt liema l-oġġetti jiġu ġġenerati, sottomessi għall-ipproċessar u/jew imħallsa għalih, li huwa mibni billi jikkonkatena:
 - kodiċi tal-aġenzija li toħroġ skont l-ISO/IEC 15459;
 - numru ta' liċenzja jew kuntratt li jaqbel mas-speċifikazzjonijiet tal-aġenzija li toħroġ kkonċernata;
 u li:
 - jikkonsisti biss fi karattri alfabetiċi u/jew numeriċi ta' ittri kbar;
 - huwa uniku (jiġifieri, huwa distint minn kwalunkwe identifikatur ieħor konformi mal-ISO/IEC 15459) fl-ambitu tal-aġenzija li toħroġ;
 - ma jistax jiġi derivat minn kwalunkwe identifikatur ieħor konformi mal-ISO/IEC 15459, maħruġ taħt l-istess aġenzija li toħroġ, billi sempliċiment jiżdiedu karattri għalih, jew jitneħħew minn, it-tarf tiegħu.

Kodiċi tal-qasam tas-sajd tal-FAO kif definit mid-Dipartiment tas-Sajd u l-Akkwakultura tal-FAO (http://www.fao.org. Fittex għas-sottos-sit tal-Kodiċi tal-Qasam tas-Sajd).
Il-karattri kollha tas-subsett definit mill-GS1 tas-ISO/IEC 646 huma permessi.
Eżempji:
18L37.1.3 Baħar tal-Punent tal-Mediterran, Sardinja;
