18L67 Paċifiku, Nofsinhar tal-Lvant.

'26L' Kodiċi tal-Post, li jkun kodiċi li jidentifika post jew żona ġeografika, jew grupp assoċjat ta' tali postijiet jew żoni, li għandu rilevanza għal transazzjoni relatata u li jikkonforma ma' waħda mill-istrutturi definiti minn (a) sa (f) hawn taħt:
a) żewġ ittri alfabetiċi kbar li jikkorrispondu mal-kodiċi tal-pajjiż ISO 3166-1 ta' żewġ ittri tal-pajjiż fejn, jew li minnu jikkonsisti, il-post(i) jew iż-żona(i) jinsabu;
b) tliet ittri alfabetiċi kbar li jikkorrispondu mal-kodiċi tal-IATA tal-ajruport jew tal-belt fejn, viċin, jew li minnu jikkonsisti, il-post(i) jew iż-żona(i) jinsabu;
c) erba' karattri jew aktar li l-ewwel tlieta jikkorrispondu għal kodiċi tal-pajjiż ISO 3166-1 segwiti minn tratt (-), bil-bqija jkunu kodiċi postali fil-pajjiż kkonċernat;
d) erba' karattri jew aktar li l-ewwel tlieta jikkorrispondu għal kodiċi tal-pajjiż ISO 3166-1 segwiti minn punt (.), bil-bqija jkunu kodiċi tas-sottodiviżjoni tal-pajjiż ISO 3166-2 fil-pajjiż kkonċernat;
e) ħames ittri alfabetiċi kbar li jikkorrispondu mal-UN/LOCODE taż-żona fejn, viċin, jew li minnu jikkonsisti, il-post(i) jew iż-żona(i) jinsabu;
f) il-konkatenazzjoni, li ma tkunx inqas minn sebgħa jew aktar minn 35 karattru fit-tul, ta':
- kodiċi tal-aġenzija li toħroġ skont l-ISO/IEC 15459;
- kodiċi tal-post, li jikkonsisti f'karattri miġbura mis-sett {A-Z; 0-9} li jaqblu mas-speċifikazzjonijiet tal-aġenzija li toħroġ kkonċernata.

