Identifikatur tal-ekwipaġġ, li jkun identifikatur globalment uniku għal apparat, oġġett ta' tagħmir jew istanza ta' applikazzjoni tal-kompjuter użata fil-produzzjoni, it-trasport, l-ipproċessar jew immaniġġjar ieħor ta' oġġetti.

Kodiċi tal-Posta UPU, li jkun kodiċi li jidentifika post jew żona ġeografika, jew grupp assoċjat ta' tali postijiet jew żoni, li għandu rilevanza għal tranżazzjoni relatata u li jikkonforma ma' waħda mill-istrutturi definiti f'a) sa g) hawn taħt:
a) żewġ karattri alfabettiċi kbar li jikkorrispondu mal-kodiċi tal-pajjiż ISO 3166-1 alfa 2 tal-pajjiż li fih, jew li jikkonsisti minnu, il-post(i) jew iż-żona(i);
b) tliet karattri alfabettiċi kbar li jikkorrispondu mal-kodiċi IATA tal-ajruport jew il-belt li fihom, qrib, jew li jikkonsisti minnhom, il-post(i) jew iż-żona(i);
c) erba' karattri jew aktar li l-ewwel tlieta jikkorrispondu mal-kodiċi tal-pajjiż ISO 3166-1 segwit minn tiret (-), bil-bqija jkunu kodiċi postali fil-pajjiż ikkonċernat;
d) erba' karattri jew aktar li l-ewwel tlieta jikkorrispondu mal-kodiċi tal-pajjiż ISO 3166-1 segwit minn punt (.), bil-bqija jkunu kodiċi ta' sottodiviżjoni tal-pajjiż ISO 3166-2 fil-pajjiż ikkonċernat;
e) ħames karattri alfabettiċi kbar li jikkorrispondu mal-kodiċi UN/LOCODE taż-żona li fihom, qrib, jew li jikkonsisti minnhom, il-post(i) jew iż-żona(i);
f) sitt karattri alfanumeriċi kbar li jikkorrispondu mal-kodiċi IMPC tal-UPU allokati skont l-istandard UPU S34;
g) il-konkatenazzjoni, li tkun mhux inqas minn seba' u mhux aktar minn 25 karattru fit-tul, ta':
 - kodiċi tal-ħruġ allokati skont l-istandards tal-UPU S31;
 - kodiċi tal-post, li jikkonsisti minn karattri meħuda mis-sett {A-Z; 0-9} li jaqblu mas-speċifikazzjonijiet tal-ħarreġ ikkonċernat.

Pjanċa tal-Liċenzja b'Data tas-Servizz u Kodiċi tal-Post huwa kostruzzjoni ta' data komposta, konformi mas-speċifikazzjoni fl-istandard UPU S25, li tinkludi speċifikazzjoni ta':
 - identifikatur tal-oġġett konformi ma' ISO/IEC 15459;
 - speċifikazzjoni konformi mal-identifikatur tad-data 5U tas-servizz li għandu jingħata rigward l-oġġett;
 - kodiċi tal-posta UPU konformi mal-identifikatur tad-data 17U jew kodiċi tal-posta UPU kwalifikat konformi mal-identifikatur tad-data 18U.
 Nota - Għal aktar dettalji, jekk jogħġbok irreferi għall-istandard UPU S25. Id-distinzjoni bejn kodiċi sempliċi tal-posta UPU (DI 17U) u kodiċi tal-posta UPU kwalifikat (DI 18U) tista' tiġi determinata mill-ewwel karattru. Jekk dan huwa numeriku, japplika 18U; jekk huwa alfabettiku, japplika 17U.

