Data Kwalifikata, li tikkonsisti f'konkatenazzjoni ta':
- kodiċi tal-aġenzija li toħroġ skont ISO/IEC 15459;
- kwalifikatur tad-data li jikkonforma mas-speċifikazzjonijiet ta' dik l-aġenzija;
- data li l-format u l-interpretazzjoni tagħha jikkonformaw mas-speċifikazzjonijiet ta' dik l-aġenzija għal dak il-kwalifikatur tad-data.

Dikjarazzjoni tal-Kategorija tal-Materjal tal-Ippakkjar*, Kodiċi* u Piż għal materjal tal-ippakkjar speċifiku użat f'ippakkjar speċifiku skont id-direttiva tal-UE dwar l-ippakkjar u l-iskart tal-ippakkjar. (Kategorija tal-materjal u kodiċi definiti fl-Anness M).
12ECCMMMMMMNNNNNUU fejn: - '12E' (an3) huwa l-Identifikatur tad-Data;
 - 'CC' (n2) huwa l-Kategorija tal-Materjal skont l-Anness M;
 - 'MMMMMM' (an1...6) huwa l-Kodiċi tal-Materjal skont l-Anness M;
 - 'NNNNN' (n5) Piż tal-Materjal, inkluża l-punt deċimali (eż., 12.12);
 - 'UU' (an2) huwa l-Unità tal-kejl għall-piż (eż., KG, GR, LB jew OZ skont ANSI X12.3 kif definit fl-Anness D).

